export const categories = [
  { name: 'Home', icon: <HomeIcon />, },
  { name: 'Described', icon: <CodeIcon />, },
  { name: 'Information', icon: <CodeIcon />, },
];

export const demoThumbnailUrl = 'https://i.ibb.co/G2L2Gwp/API-Course.png';
